    }
  }
  alunoSobMedicamento = ( classtextfieldnumero) => {
    if(this.state.usoalgummedicamento == '2'){
    return (<div>
    <div >
      <TextField
       id="usoalgummedicamentosim"
       label="Qual(is)?"
       className={classtextfieldnumero}
       value={this.state.usoalgummedicamentosim}
