    }
  }
  alunoTeveDoençaGrave = ( classtextfieldnumero) => {
    if(this.state.tevedoençagrave == '2'){
    return (<div>
    <div >
      <TextField
       id="tevedoençagravesim"
       label="Qual(is)?"
