    return (<div>
    <div >
      <TextField
       id="alergicoreaçãoadversasim"
       label="Qual(is)?"
       className={classtextfieldnumero}
       value={this.state.alergicoreaçãoadversasim}
       onChange={this.handleChange('alergicoreaçãoadversasim')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div >
      </div>)
    }
  }
  alunoAlergicoReaçãoAdversa = ( classtextfieldnumero) => {
    if(this.state.alergicoreaçãoadversa == '2'){
    return (<div>
    <div >
      <TextField
       id="alergicoreaçãoadversasim"
       label="Qual(is)?"
       className={classtextfieldnumero}
       value={this.state.alergicoreaçãoadversasim}
       onChange={this.handleChange('alergicoreaçãoadversasim')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div >
      </div>)
    }
  }
  alunoApresentaIntolerância = ( classtextfieldnumero) => {
    if(this.state.apresentaintolerância == '5'){
    return (<div>
    <div >
      <TextField
       id="apresentaintolerânciaoutro"
       label="Qual?"
       className={classtextfieldnumero}
       value={this.state.apresentaintolerânciaoutro}
       onChange={this.handleChange('apresentaintolerânciaoutro')}
       margin="normal"
       variant='outlined'
     />
   </div>
   </div>)
    }else{
      return(
      <div >
      </div>)
    }
  }
  salvarDados = () => {
    if(this.state.iddoaluno == ""){
        alert('Adicione o ID do Aluno')
    }else{
    }
}
  handleChange = name => event => {
    this.setState({ [name]: event.target.value });
  };
